'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/Coders-Haven/contributor/','title':"Contributor",'section':"Introduction",'content':"Contributors #   Thanks #  It is due to these people that this website has the content that it has\n Contributors #  Maanuj Voraactions-userapps/github-actions  "});index.add({'id':1,'href':'/Coders-Haven/docs/java/datatypes/','title':"Datatypes",'section':"Introduction",'content':"Datatypes #   We will be exploring different datatypes\n  Integer - int Double - double Boolean - boolean String - String   Integer #   Any whole number  Double #   Any number with a decimal  Boolean #   True or False  String #   Any letters, numbers, and characters Quotation marks are needed around the value   Integer #  Integers are usually defined as so,\nint x = 12; This is showing that the value of zero is being assigned to the integer variable called x.\nints can only store integers.\n Double #  Doubles are usually defined as so,\ndouble y = 2.1; This is showing that the value of 2.1 is being assigned to the double called y.\ndoubles can store both integers, and numbers with decimals, but it will convert an integer to a double\n Booleans #  Booleans are usually defined as so,\nboolean z = true; Booleans can only equal to true or false.\n Strings #  Strings are basically words that can be stored as a variable. To define one, you would write,\nString a = \u0026#34;You would need to use quotes to write a string\u0026#34;; Strings can contain words and numbers.\n Extra #  You can print out a variable too.\nSystem.out.println(x); This statement would print out the value of x, which is 0\nSystem.out.println(y); If you replaced the x with y, it would now print out the value 2.1\nSystem.out.println(z); If you then replaced the y with z, it would then print out the value true\nSystem.out.println(a); And finally, if you were to replace the z with a, then it would print out, \u0026quot;You would need to use quotes to write a string\u0026quot; , since that is the sentence defined in the string a\n"});index.add({'id':2,'href':'/Coders-Haven/docs/java/helloworld/','title':"Hello World",'section':"Introduction",'content':"Hello World #   We will be printing out the sentence \u0026lsquo;Hello World\u0026rsquo;\n public class HelloWorld { public static void main(String[] args) { System.out.println(\u0026#34;Hello World\u0026#34;); } }  Parts #   public class HelloWorld {  We defined a public class named HelloWorld . We will get to classes later   public static void main(String[] args) {  We wrote out, public static void main(String[] args), which is a declaration in which we will later go into in detail   System.out.println(\u0026quot;Hello World\u0026quot;);  Is a common way to print out phrases. To print out phrases, they need to be in quotes   { }  The curly brackets, { }, are used to define what is in a function.   ;  After each line of code that is not declaring a class or a main, we usually put a semi-colon(;) after it    "});index.add({'id':3,'href':'/Coders-Haven/docs/java/publicvprivatevprotected/','title':"Public Vprivate Vprotected",'section':"Introduction",'content':"Public Versus Private Versus Protected #   Public #  The public keyword essentially means that this method or class can be access by anyone who has access to the file, and other files in the project would be able to access these methods\nPrivate #  The private keyword essentially means that this method can only be access within this file itself\nProtected #  The protected keyword essentially means that different files can access the methods/functions/code inside the protected object, but it cannot change and values inside of it\n"});index.add({'id':4,'href':'/Coders-Haven/docs/python/casting/','title':"Casting",'section':"Introduction",'content':"Casting #   Casting is used to switch one type of datatype into another through certain functions\nWhy is it needed? #  It is neccessary to know this since inputs are recieved in the form of strings, and if you wanted a numerical input from the user you would not be able to without the use of casting\n Functions for Casting #   int() #  The int() function will cast anything inside the parenthesis into an integer, only if it is possible to\nThis will round down any decimal values inputted\nint(\u0026#34;5\u0026#34;) \u0026gt; 5 int(\u0026#34;10\u0026#34;) \u0026gt; 10 int(\u0026#34;10.4\u0026#34;) \u0026gt; Error int(10.1) \u0026gt; 10 int(10.44) \u0026gt; 10 int(\u0026#34;Hi\u0026#34;) \u0026gt; Error int(True) \u0026gt; 1 int(False) \u0026gt; 0  str() #  The str() function will convert anything between the parenthesis into a String object if possible(which the answer is it usually is)\nstr(5) \u0026gt; \u0026#34;5\u0026#34; str(6.11) \u0026gt; \u0026#34;6.11\u0026#34; str(True) \u0026gt; \u0026#34;True\u0026#34; str(\u0026#34;String\u0026#34;) \u0026gt; \u0026#34;String\u0026#34;  float() #  The float() function will convert anything between the parenthesis into a float, only if it is possible to do\nfloat(5) \u0026gt; 5.0 float(5.1111) \u0026gt; 5.1111 float(\u0026#34;5.1241\u0026#34;) \u0026gt; 5.1241 float(True) \u0026gt; 1.0 float(False) \u0026gt; 0.0  bool() #  Will return a True of False value of anything inputted into the parenthesis\nEssentially, it will return True for anything inside if it is not a 0 nor empty\nbool(10) \u0026gt; True bool(1000.001212144) \u0026gt; True bool(0) \u0026gt; False "});index.add({'id':5,'href':'/Coders-Haven/docs/python/datatypes/','title':"Datatypes",'section':"Introduction",'content':"Datatypes #   We will be exploring different datatypes\n  Integer String Float Boolean   Integer #   Any whole number  String #   Any letters, numbers, and characters Quotation marks are needed around the value  Float #   Any number with a decimal  Boolean #   True or False   The type() Function #  type()  By adding any variable inside the parenthesis, it will return the type of it  "});index.add({'id':6,'href':'/Coders-Haven/docs/python/helloworld/','title':"Hello World",'section':"Introduction",'content':"Hello World #   We will be printing out the sentence \u0026lsquo;Hello World\u0026rsquo;\n print(\u0026#34;Hello World\u0026#34;)  Parts #   print()  It prints out words or variables between the parenthesis   \u0026ldquo;Hello World\u0026rdquo;  A string with the value of Hello World is made    "});index.add({'id':7,'href':'/Coders-Haven/docs/python/ifstatements/','title':"If Statements",'section':"Introduction",'content':"If Statements #   If Statements are composed of some parts\n if(condition): code elif(condition): code else: code  Breaking it down #   if -\u0026gt; if  needs a condition   elif -\u0026gt; else if  needs a conditions the second condition you can have as many of these as you want   else -\u0026gt; else  does not need a condition     There are 3 Rules #    NEVER, NEVER EVER, call a If Statment an If Loop    The conditions will almost always use operators    The conditions have to be true for a block of code to execute     Examples #  x = 4 if(x \u0026lt; 5): print(\u0026#34;James is super smart\u0026#34;) elif(x == 6): print(\u0026#34;The smartest boi in the world is currently traveling\u0026#34;) else: print(\u0026#34;James is a smartie\u0026#34;) "});index.add({'id':8,'href':'/Coders-Haven/docs/python/input/','title':"Input",'section':"Introduction",'content':"Input #   The input() function will pose a prompt to the user, in which the answer to the question will be returned to the program\nRemember that all responses will be stored in a string even if they are numbers, so use casting!\nExample\ninput(\u0026#34;What is your name?\u0026#34;) \u0026gt; \u0026#34;Maanuj\u0026#34; input(\u0026#34;What is your age?\u0026#34;) \u0026gt; \u0026#34;17\u0026#34; input(\u0026#34;Are you alive?\u0026#34;) \u0026gt; \u0026#34;False\u0026#34; "});index.add({'id':9,'href':'/Coders-Haven/docs/python/lists/','title':"Lists",'section':"Introduction",'content':"Lists #   Lists are a special type of datatype which can hold multiple values within it\nLists can hold any type of datatype within it\nLists start at an index of 0(like most things in the virtual world), instead of 1\n Things about Lists #  Declaring an List #  lst = [ ] This makes an empty list named lst\nAdding objects to an List #  lst = [ ] lst.append(\u0026#34;Cars\u0026#34;) This adds the string \u0026ldquo;Cars\u0026rdquo; to the list lst . The list now looks like this\n\u0026gt; [\u0026#34;Cars\u0026#34;] Modifying the first item in the List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] lst[0] = \u0026#34;Doofus\u0026#34; This will take the item in the 0th index, and replace the previous value with the new value provided. The list now looks like this\n\u0026gt; [\u0026#34;Doofus\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] Find the length of an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] length = len(lst) This will use the len() function on the list, lst , the is passed in, and give the variable \u0026lsquo;length\u0026rsquo; the length of the list. The value of length is\n\u0026gt; 3 Popping an item from an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] lst.pop(1) This will use the pop() function to remove the item at index number 1. This will result in the list lst being\n\u0026gt; [\u0026#34;Cars\u0026#34;, \u0026#34;Apple\u0026#34;] Removing an item from an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] lst.remove(\u0026#34;Candy\u0026#34;) This will use the remove() function to remove the item with the value specified between the parenthesis. It will result in the list lst being\n\u0026gt; [\u0026#34;Cars\u0026#34;, \u0026#34;Apple\u0026#34;] Clearing an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] lst.clear() This will clear the list, resulting in there being an empty list. It will result in the list lst being\n\u0026gt; [ ] Finding the index of an item in an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] index = lst.index(\u0026#34;Apple\u0026#34;) This will find the item with the value \u0026ldquo;Apple\u0026rdquo; in the list lst and return the index of its first occurence in the list. It will then store it in the index variable. The index variable, in the end, will hold the value\n\u0026gt; 2 Sorting an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] lst.sort() This will sort the list lst by ascending to descending. It will result in lst being\n\u0026gt; [\u0026#34;Apple\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Cars\u0026#34;] Reversing an List #  lst = [\u0026#34;Cars\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Apple\u0026#34;] lst.reverse() This will reverse the list lst . It will result in lst being\n\u0026gt; [\u0026#34;Apple\u0026#34;, \u0026#34;Candy\u0026#34;, \u0026#34;Cars\u0026#34;] "});index.add({'id':10,'href':'/Coders-Haven/docs/python/operators/','title':"Operators",'section':"Introduction",'content':"Operators #   Operators are used in many scenarios. Note that there are two types of operators\n Logic Operators Mathematical Operators  Logic Operators #   Used for comparisions between two or more objects  Mathematical Operators #   Used for mathematical operations   Examples of Logic Operators #   == (Checking if two things are equal) != (Checking if two things are not equal) \u0026gt; (Checking if the first object is greater than the second object) \u0026lt; (Checking if the first object is less than the second object) \u0026gt;= (Checking if the first object is greater than or equal to the first object) \u0026lt;= (Checking if the first object is less than or equal to the first object) || (If this is true or that is true, then the whole thing is true) (Only in If Statement) \u0026amp;\u0026amp; (This and that have to be true for the whole thing to be true) (Only in If Statement) and (If this is true or that is true, then the whole thing is true) or (This and that have to be true for the whole thing to be true)  Examples of Mathematical Operators #   + (Adding two items) - (Subtracting two items) \\* (Multiplying two items) / (Dividing two items) % (Modulus(Basically remainder))  "});index.add({'id':11,'href':'/Coders-Haven/docs/python/strings/','title':"Strings",'section':"Introduction",'content':"Strings #   You know that Strings are one type of datatype, but there is more to Strings than just that\n Strings are like arrays #  You can get a certain character at a specific position in a string like an array using an index.\na = \u0026#34;Hello World\u0026#34; print(a[1]) This will print out\ne since the character \u0026lsquo;e\u0026rsquo; is at the first index of the String\nThe length of a string #  You can get the length of a string using the len() function\na = \u0026#34;Hello World\u0026#34; print(len(a)) This will return\n11 since there are 11 characters in the string\n  H\n  e\n  l\n  l\n  o\n   W\n  o\n  r\n  l\n  d\n  Removing blanks in a string #  You can remove leading or trailing blanks in a string using the strip() function\na = \u0026#34; Hello World \u0026#34; print(a.strip()) This will return\nHello World Without any leading or trailing empty spaces\nLowercasing the String #  The lower() method will lowercase the characters in a string\na = \u0026#34;Hello World\u0026#34; print(a.lower()) This will return\nhello world Uppercasing the String #  The upper() method will uppercase the characters in a string\na = \u0026#34;Hello World\u0026#34; print(a.upper()) This will return\nHELLO WORLD Replacing characters in a String #  The replace() method will replace strings with a different string in a string\na = \u0026#34;Hello World\u0026#34; print(a.replace(\u0026#34;H\u0026#34;, \u0026#34;J\u0026#34;)) This will return\nJello World Splitting a String #  The split() method will split a string into an array if there is an occurence of a certain string\na = \u0026#34;Hello World\u0026#34; print(a.split(\u0026#34;l\u0026#34;)) This will return\n[\u0026#34;He\u0026#34;, \u0026#34;\u0026#34;, \u0026#34;o Wor\u0026#34;, \u0026#34;d\u0026#34;] Checking if a string is present #  The in keyword and not in keywords can help distinguish whether a certain string is present in a string or not (resulting in a boolean)\ntxt = \u0026#34;Hello World\u0026#34; x = \u0026#34;llo\u0026#34; in txt print(x) This will return\nTrue Adding variables in a string #  You can use the format() function to easily insert variables into a string\nage = 17 name = \u0026#34;Dino\u0026#34; intro = \u0026#34;Hi, my name is {}, and I am {} years old\u0026#34; print(intro.format(name, age)) This will return\nHi, my name is Dino, and I am 17 years old Special Characters in Strings #  There are some special characters within strings\n \\n  New line   \\\\  Backslash   \\t  Tab   \\r  Carriage Return    Finding the index of a certain part #  You can find the index of a certain string within the string\na = \u0026#34;Hello World\u0026#34; print(a.index(\u0026#34;l\u0026#34;)) This will return\n2 It returned the index of the first occurence of the string within the original string\n"});index.add({'id':12,'href':'/Coders-Haven/docs/python/variables/','title':"Variables",'section':"Introduction",'content':"Variables #   Any item/name that is referencing/stores another item in storage\n Variables can have any name #  For example\n x Dino Is_A Smart1e   Instanitating a Variable #  For example\nx = 5 Dino = \u0026#34;Ok\u0026#34; Is_A = 0.01 Smart1e = True  Printing Variables #  Place the variable name in the parenthesis of the print() function\n"});index.add({'id':13,'href':'/Coders-Haven/docs/java/','title':"Introduction",'section':"Docs",'content':"Welcome to Java #   Here you will learn more about the basic fundamentals of Java itself\n "});index.add({'id':14,'href':'/Coders-Haven/docs/python/','title':"Introduction",'section':"Docs",'content':"Welcome to Python #   Here you will learn more about the basic fundamentals of Python itself\n "});})();